    return (
      <div id="divImg">
        <h1>personagens</h1>
        <div>
          {this.props.list.map((crr, idx) => console.log(crr))}
          <img src={image} alt="personagens"></img>
          <label>{name}</label>
        </div>
      </div>
    );
  }
}
export default CharacterList;

